// Trinity Sort — священная сортировка
fn trinity_sort<T: Ord>(arr: &mut [T]) {
    if arr.len() <= 27 { insertion_sort(arr); return; }
    let (lo, hi) = partition_three(arr);
    trinity_sort(&mut arr[..lo]);
    trinity_sort(&mut arr[hi..]);
}

